import React from 'react';
import Card from './Card';

const CardArray = ({robotjs}) => {
  
    return (
        <div>
           {
               robotjs.map((user,i) => {
                return (<Card
                    key={robotjs[i].id}
                    id={robotjs[i].id}
                    name={robotjs[i].name}
                    email={robotjs[i].email}
                    />)
            })
           } 
        </div>
    );
}

export default CardArray;
